import React, { useState } from "react";
import DataTable from "react-data-table-component";
import {
  useGetAirportsQuery,
  useDeleteAirportMutation,
} from "../../redux/api/airportApi";
import AirportForm from "./AirportForm";
import toast from "react-hot-toast";

const AirportList = () => {
  const { data, isLoading, refetch } = useGetAirportsQuery();
  const [deleteAirport] = useDeleteAirportMutation();
  const [editingAirport, setEditingAirport] = useState(null);
  const [showForm, setShowForm] = useState(false);
  const [searchText, setSearchText] = useState("");

  const handleDelete = async (id) => {
    if (window.confirm("Are you sure?")) {
      await deleteAirport(id);
      toast.success("Airport deleted");
      refetch();
    }
  };

  // NEW COLUMNS based on your updated schema
  const columns = [
    {
      name: "IATA Code",
      selector: (row) => row.iata_code || "-",
      sortable: true,
      width: "120px",
    },
    {
      name: "Airport Name",
      selector: (row) => row.name || "-",
      sortable: true,
      wrap: true,
    },
    {
      name: "Municipality",
      selector: (row) => row.municipality || "-",
      sortable: true,
    },
    {
      name: "Country",
      selector: (row) => row.iso_country || "-",
      sortable: true,
      width: "120px",
    },
    {
      name: "Region",
      selector: (row) => row.iso_region || "-",
      sortable: true,
      width: "140px",
    },
    {
      name: "Type",
      selector: (row) => row.type || "-",
      sortable: true,
      width: "150px",
    },
    {
      name: "Latitude",
      selector: (row) => row.latitude_deg || "-",
      sortable: true,
      width: "120px",
    },
    {
      name: "Longitude",
      selector: (row) => row.longitude_deg || "-",
      sortable: true,
      width: "120px",
    },
    {
      name: "Status",
      selector: (row) => row.status,
      sortable: true,
      width: "100px",
      cell: (row) => (
        <span
          className={`badge ${
            row.status === "active" ? "bg-success" : "bg-secondary"
          }`}
        >
          {row.status}
        </span>
      ),
    },
    {
      name: "Actions",
      width: "120px",
      cell: (row) => (
        <div className="dropdown">
          <button
            className="btn btn-sm btn-secondary dropdown-toggle"
            type="button"
            data-bs-toggle="dropdown"
          >
            Actions
          </button>

          <ul className="dropdown-menu">
            <li>
              <button
                className="dropdown-item"
                onClick={() => {
                  setEditingAirport(row);
                  setShowForm(true);
                }}
              >
                Edit
              </button>
            </li>
            <li>
              <button
                className="dropdown-item text-danger"
                onClick={() => handleDelete(row._id)}
              >
                Delete
              </button>
            </li>
          </ul>
        </div>
      ),
    },
  ];

  // Updated Search — checks all fields from new schema
  const filteredData = data?.airports?.filter((airport) =>
    JSON.stringify(airport).toLowerCase().includes(searchText.toLowerCase())
  );

  return (
    <div className="container mt-4">
      <div className="d-flex justify-content-between align-items-center mb-3">
        <h2>Airport Management</h2>

        <button
          className="btn btn-primary"
          onClick={() => {
            setEditingAirport(null);
            setShowForm(!showForm);
          }}
        >
          {showForm ? "Close Form" : "Add Airport"}
        </button>
      </div>

      {showForm && (
        <AirportForm
          editingAirport={editingAirport}
          setShowForm={setShowForm}
          refetch={refetch}
        />
      )}

      <div className="mb-3">
        <input
          type="text"
          placeholder="Search Airports..."
          className="form-control"
          value={searchText}
          onChange={(e) => setSearchText(e.target.value)}
        />
      </div>

      <DataTable
        columns={columns}
        data={filteredData || []}
        progressPending={isLoading}
        pagination
        highlightOnHover
        responsive
        noDataComponent="No airports found"
        persistTableHead
      />
    </div>
  );
};

export default AirportList;
